        uint256 pollId
    ) public view returns (uint256, uint256, string memory) {
        Poll memory poll = polls[pollId];

        if (poll.state == PollState.Ongoing) {
            return (poll.yesVotes, poll.noVotes, "Ongoing");
        } else {
            return (poll.yesVotes, poll.noVotes, "Ended");
        }
    }

